function LocomotiveButton({isFocused, currentLocomotive }) {
  return (
    <>
    {isFocused ? (
        <button className="btn_locomotive_focused" key={wagon_number} onClick={() => handleWagonClick(wagon_number)}>
            {wagon_number + 1}
        </button>
    ) : (
        <button className="btn_locomotive" key={wagon_number} onClick={() => handleWagonClick(wagon_number)}>
            {wagon_number + 1}
        </button>
    )}
    </>
  );
}
  
export default LocomotiveButton;
